!function(){let n=document.title.replace(/^(INC\d+).*$/,"$1"),e=document.getElementById("gsft_main").contentWindow.document.getElementById("incident.description"),o=e?e.value:"";console.log(n+" description:",o);let t="Link:("+encodeURIComponent("https://canvas.harvard.edu")+"\\S+)";console.log(n+" pattern:",t);let l=o.match(t),c=l?decodeURIComponent(l[1]):null;if(console.log(n+" url: "+c),c){window.confirm("Successfully extracted canvas link for "+n+".\n\nOpen "+c+" in new window?")&&window.open(c,"_blank")}else alert("Canvas link not found in description of "+n)}();
